import styled from 'styled-components';

export const Wrapper = styled.div `
	padding-top: 10px;
	font-size: 1em;
	height: 100vh;
	width: 100vw;
	position: relative;
	text-align: center;

`;

export const Content = styled.div `
	margin-top: 3.5em;
	width: 100%;
	height: 100%;
	background-color: #3776ab;
	padding-left: 4em;
	padding-top:2em;
	position:relative;
    .form {
      padding-bottom: 5em;
    }

`;



export const SignIn = styled.div `


`;
